svg.script:
// 
    var svgNS = "http://www.w3.org/2000/svg";
    var view;
    var rect;
    var svg;
    var wt, ht, xt, yt, w1, h1, x1, t1;
    var t;
    var timeout;

    function setup() {
        svg=document.getElementsByTagName("svg")[0];
        view=document.getElementById("layer3");
        rect=view.firstChild;
        while (!(rect instanceof SVGRectElement)) {
            rect=rect.nextSibling;
        }
        wt=w1=rect.width.baseVal.value;
        ht=h1=rect.height.baseVal.value;
        xt=x1=rect.x.baseVal.value;
        yt=y1=rect.y.baseVal.value;
        svg.setAttributeNS(null, "width", "100%");
        svg.setAttributeNS(null, "height", "100%");
        svg.setAttributeNS(null, "viewBox", ""+x1+" "+y1+" "+w1+" "+h1);
        document.documentElement.addEventListener('keydown',keydown,false);
    }

    function next() {
        var temp=rect.nextSibling;        
        while ( (temp!=null) && (! (temp instanceof SVGRectElement)) ) {
            temp=temp.nextSibling;
        }
        if (temp==null) {
            //console.log("Reached end.");
            return;
        }
        rect=temp;
        w1=rect.width.baseVal.value;
        h1=rect.height.baseVal.value;
        x1=rect.x.baseVal.value;
        y1=rect.y.baseVal.value;
        if (rect.hasAttributeNS(null,"onfocusin")) {
            var cmd=rect.getAttributeNS(null,"onfocusin");
            eval(cmd);
        }
        startMove();
    }

    function prev() {
        if (rect.hasAttributeNS(null,"onfocusout")) {
            var cmd=rect.getAttributeNS(null,"onfocusout");
            eval(cmd);
        }
        //console.log(rect);
        var temp=rect.previousSibling;        
        while ( (temp!=null) && (! (temp instanceof SVGRectElement)) ) {
            temp=temp.previousSibling;
        }
        if (temp==null) {
            //console.log("Reached start.");
            return;
        }
        rect=temp;
        w1=rect.width.baseVal.value;
        h1=rect.height.baseVal.value;
        x1=rect.x.baseVal.value;
        y1=rect.y.baseVal.value;
        startMove();
    }

    function startMove() {
        if (timeout!=null) {
          // This stops the animation:
          clearTimeout(timeout);
          timeout=null;
        }
        t=20;
        timeout=setTimeout(update,20);
    }

    function keydown(evt){
        //console.log(evt);
    	switch (evt.which){
            case 40:
                next();
	            break;
            case 38:
                prev();
	            break;
        }
    }

    function update(){

        wt=(w1+t*wt)/(t+1);
        ht=(h1+t*ht)/(t+1);
        xt=(x1+t*xt)/(t+1);
        yt=(y1+t*yt)/(t+1);
        svg.setAttributeNS(null, "viewBox", ""+xt+" "+yt+" "+wt+" "+ht);
        if (t>0) {
            t=t-1;
            timeout=setTimeout(update,20);
        }
    }

    function go1() {
        var tohide=document.getElementById("change1");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        tohide.setAttributeNS(null, "visibility", "hidden");
        var toshow=document.getElementById("change2");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");
    }

    function back1() {
        var tohide=document.getElementById("change2");
        tohide.setAttributeNS(null, "visibility", "hidden");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        var toshow=document.getElementById("change1");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");        
    }

    function go2() {
        var tohide=document.getElementById("change2");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        tohide.setAttributeNS(null, "visibility", "hidden");
        var toshow=document.getElementById("change3");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");
    }

    function back2() {
        var tohide=document.getElementById("change3");
        tohide.setAttributeNS(null, "visibility", "hidden");
        if (tohide.hasAttributeNS(null, "style")) {
            tohide.removeAttributeNS(null, "style");
        }
        var toshow=document.getElementById("change2");
        if (toshow.hasAttributeNS(null, "style")) {
            toshow.removeAttributeNS(null, "style");
        }
        toshow.removeAttributeNS(null, "visibility");        
    }


//

g.ns0:text:
\begin{cenumerate}
\item Place a canonical and useful topology on the space $\sM$ of all (pointed) translation surfaces.
\item Describe some facts about the topology.
\item Describe some dynamical consequences.
\end{cenumerate}

\begin{citemize}
\item A Riemann surface equipped with a holomorphic $1$-form.
\item Surfaces built by gluing together Euclidean polygons by translations.
\item Polygonal billiards.
\item Suspensions of interval exchange maps.
\end{citemize}

\begin{cenumerate}
\item Topologize $\tM$, the space of (pointed) translation surfaces homeomorphic to an open disk.
\item Topologize $\tE$, the disk bundle over $\tM$.
\item Topologize $\sM$, the space of all (pointed) translation surfaces, (and $\sE$, the surface bundle over $\sM$).
\end{cenumerate}

\begin{cenumerate}
\item For every closed topological disk $K \subset \tilde S$ containing the basepoint,
$K \imm \tilde S_n$ for $n$ sufficiently large.
\item For all $U \in \tM$, if $U \imm \tilde S_n$ for infinitely many $n$, then $U \imm \tilde S$.
\end{cenumerate}

\begin{cenumerate}
\item[A.] $\tilde S_n$ converges to $\tilde S$ in $\tM$, and
\item[B.] a point $\tilde p \in \tilde S$ is a lift of $s \in S$ if and only if
there is a sequence $\tilde p_n \in \tilde S_n$ so that $(\tilde S_n, \tilde p_n)$
converges to $(\tilde S,\tilde p)$ in $\tE$. 
\end{cenumerate}

Let $(\tilde S_n, p_n)$ be a sequence in $\tE$. Then,
the sequence converges to $(S,p) \in \tE$ if 
\vspace{-1em}

\begin{cenumerate}
\item $\tilde S_n \to \tilde S$ in $\tM$, and
\item for one (equivalently all) closed disk $K \subset \tilde S$ with $p \in K^\circ$,
the immersions $\iota_n:K \imm \tilde S_n$ satisfy $d_n\big(p_n,\iota_n(p)\big) \to 0$. 
\end{cenumerate}

\begin{citemize}
\item One uses more general work of Rodrigo Tevi\~no.
\item A second mirrors Masur's proof from the finite genus case.
\end{citemize}

If Lebesgue measure $\lambda$ on $S$ is non-ergodic, then there is a continuous
and compactly supported $f$ on $S$ (with $B=B(f)$ as above), positive measure subsets
\\ $B_-, B_+ \subset B$, and real constants $\kappa_-<\kappa_+$ so that
\vspace{-1em}

\begin{citemize}
\item $\text{avg}(x)<\kappa_-$ for all $x \in B_-$, and
\item $\text{avg}(x)>\kappa_+$ for all $x \in B_+$.
\end{citemize}
